Hello,

we have an image processing application using the OpenVino GPU Backend, where we pre-allocate two tensors for our input/output:

```cpp
   OrtOpenVINOProviderOptions options;
   options.device_type = "GPU_FP32";
   options.num_of_threads = 1;
   auto sessionOptions = Ort::SessionOptions();
   sessionOptions.AppendExecutionProvider_OpenVINO (options);

    _pSession = std::make_unique <Ort::Session>(
        Ort::Session{ _env, onnxFilePath.c_str(), sessionOptions });
    _memoryInfo = std::make_unique<Ort::MemoryInfo>(Ort::MemoryInfo::CreateCpu(OrtDeviceAllocator, OrtMemTypeCPU));

    _output = std::make_unique<float[]> (_outputSize * 10);
    _input = std::make_unique<float[]> (_inputSize * 10);
    
    _inputOnnxTensor = Ort::Value::CreateTensor<float>(*_memoryInfo,
                                                       _input.get(), _inputSize,
                                                       _inputShape.data(), _inputShape.size());
    _outputOnnxTensor = Ort::Value::CreateTensor<float>(*_memoryInfo,
                                                        _output.get(), _outputSize,
                                                        _outputShape.data(), _outputShape.size());
```
and then in our processing loop, per camera frame, we run the network:

```cpp
    _pSession->Run(_runOptions,
                   _inputLayerNames.data(), &_inputOnnxTensor, 1,
                   _outputLayerNames.data(), &_outputOnnxTensor, 1);      
```                   
By overloading the new- and delete-operators, we can clearly see, that we get get a huge number of allocations (1551921) and deallocations (1332678) per frame increasing over time while executing the network. Our application timing then suffers over time due to the increasing number of allocations and memory fragmentation. I looked at the documentation, but I could not find a way for using memory-pooling or other techniques to stop the allocations per frame. 

It would be great, If you can point me in the right direction. For our application I try to use memory pooling where possible, to avoid such effects.

Best regards
Philipp

