For the Squeeze operation the shape-inference ins not working properly ***if no axes are provided***. In this case all the dimensions equal to 1 should be removed from the input-shape (see: [Squeeze](https://github.com/onnx/onnx/blob/master/docs/Operators.md#squeeze)), but currently all dimensions are removed by shape-inference, independent of their value. This is due to the â€˜non-symbolicâ€™ shape inference called in _onnx_infer_single_node(â€¦) not working properly in this case. 

Fixes #7356

@KeDengMS

Address perf issue in https://github.com/microsoft/onnxruntime/issues/7212 

Problem: 
- AlgoSearchWorkspaceSize was set to 32MB. The workspace size is too small that cudnnFindConvolutionForwardAlgorithmEx couldn't find the optimal algorithm for Conv forward. (The final algo end up requiring 169 MB workspace)
- In Conv1D case, if the input shape is [N, C, D], ORT is padding it to [N, C, D, 1]. This is not as efficient as padding to [N, C, 1, D]. 

